import React from "react";
import { FC } from "react";
import Form from 'react-bootstrap/Form'
import Col from "react-bootstrap/Col";
import Row from "react-bootstrap/Row";


export const ContactInfo: FC = (props) => {

const {partnerMail, partnerPhone} = props; 


    return(
        <div className="form__container">
            <h2>Контакты</h2>
        <Form>
        <Form.Group as={Row} controlId="formHorizontalEmail">
          <Form.Label column sm={2}>
            {partnerMail}
          </Form.Label>
          <Col sm={10}>
            <Form.Control type="email" placeholder="Email"   defaultValue="example@kk.com"/>
          </Col>
        </Form.Group>
        <Form.Group as={Row} controlId="formHorizontalPhone">
          <Form.Label column sm={2}>
           {partnerPhone}
          </Form.Label>
          <Col sm={10}>
            <Form.Control type="phone" placeholder="Phone"   defaultValue="+79241234432"/>
          </Col>
        </Form.Group>
        </Form>
        </div>
    )

    }
